import React from "react";
import "./Register.css";
function Register(){
    return(
        <div className="Register">
                <div className="formContainer">
                <h1 className="header" id="loginTitle">User Registration</h1>
                <div className="form">
                    <br />
                    <form action method="post">
                    <input type="text" name="name" placeholder="Name" className="inputField" />
                    <br />
                    <input type="text" name="lastName" placeholder="Last Name" className="inputField" />
                    <br />
                    <input type="email" name="email" placeholder="Email" className="inputField" />
                    <br />
                    <input type="text" name="username" placeholder="Username" className="inputField" />
                    <br />
                    <input type="password" name="password" placeholder="Password" className="inputField" />
                    <br />
                    <button className="submitButton">Register</button>
                    {/* <button class="submitButton">Login as admin</button> */}    
                    <p><a href="/Users/logee/Documents/Codes/miniProject/finance-system/login.html" className="link">Already Registerd? Login</a></p>
                    </form>
                </div>
                </div>
        </div>
    );
}



export default Register;
